import React from 'react';
import Header from './Header';
import AttendanceHome from './AttendanceHome';
import './App.css';

function App() {
  return (
    <div className="app">
      <div className="main-flex">
        <Header />
        <AttendanceHome />
      </div>
    </div>
  );
}

export default App;
